import React from 'react';
import './card.css'
const Card = ({ title, description, image }) => {
  return (
    <div className="card">
      <img src={image} alt={title} className={"img"}/>
      <h2>{title}</h2>
      <p>{description}</p>
    </div>
  );
};

export default Card;
